import c from './Dialogs.module.css';
import React from 'react';
import { NavLink } from 'react-router-dom';

const DialogItems = (props) => {

    let path = "/dialogs/" + props.id;

    return (
        <div className={c.User}>
            <img src="https://image.flaticon.com/icons/png/512/108/108186.png" className={c.Avatar} />
            <span><NavLink to={path} activeClassName={c.Active}>{props.name}</NavLink></span><hr />
        </div>
    )
}

const Dialogs = (props) => {
    return (
        <div className={c.Dialogs}>
            <div className={c.Users}>
                <DialogItems name="Pavel" id="1"/>
                <DialogItems name="Petr1" id="2"/>
                <div className={c.User}>
                    <img src="https://image.flaticon.com/icons/png/512/108/108186.png" className={c.Avatar} />
                    <span><NavLink to="/dialogs/2" activeClassName={c.Active}>Petr</NavLink></span><hr />
                </div>
                <div className={c.User}>
                    <img src="https://image.flaticon.com/icons/png/512/108/108186.png" className={c.Avatar} />
                    <span><NavLink to="/dialogs/3" activeClassName={c.Active}>Dima</NavLink></span><hr />
                </div>
                <div className={c.User}>
                    <img src="https://image.flaticon.com/icons/png/512/108/108186.png" className={c.Avatar} />
                    <span><NavLink to="/dialogs/4" activeClassName={c.Active}>Anton</NavLink></span><hr />
                </div>
            </div>
            <div className={c.Line}></div>
            <div className={c.Messages}>
                <div className={c.Dialog}>Hi</div>
                <div className={c.Dialog}>How are you?</div>
                <div className={c.Dialog}>Bye</div>
            </div>
        </div>
    )
}

export default Dialogs;
